import React from 'react';

const Informatie = () => {
    return (
        <div className="InfoPage">
            <div className="TopFiller"></div>

            <div className="leftContainer">
                <p>Informatie Page</p>
            </div>

            <div className="rightContainer">
                <p>Lorem Ipsum</p>
            </div>


        </div>
    )
}

export default Informatie;
